import React from 'react'
import'./Main.css';


function Main() {
  return (
    <div className="card">
      <div class='cards'>
     <img src="https://cdn-icons-png.flaticon.com/128/2150/2150150.png" class="rounded-card1"/> card1
      <div class='card2'><img src=" https://cdn-icons-png.flaticon.com/128/2965/2965335.png" class="rounded-card2"/>card2</div>   
      <div class='card3'><img src="https://cdn-icons-png.flaticon.com/128/10196/10196781.png" class="rounded-card3"/>card3</div>
      <div class='card4'><img src="https://cdn-icons-png.flaticon.com/128/9321/9321075.png" class="rounded-card4"/>card4</div>
    </div>
    </div>
  )
}

export default Main;
